重启设备的服务

重启该设备的所有容器应用服务以及原生应用服务。

> - 容器应用：删除并重新创建容器(保存在容器文件系统上的所有数据将丢失);
> - 原生应用：停止并重新启动;

第六步：发布 Release

点击`发布`按钮，正式发布 Release。

> **注意**
>
> 容器应用可以不上传镜像文件，Jelina 会根据 image 标签的内容去 DockerHub 上拉取;
>
> 原生应用必须上传镜像文件，并填写启动命令;
>
> 只有正式发布后的 Release 才能被部署到设备上;
>
> Release 发布之后，不可再更改;
>
> 设备默认会自动安装舰队中最新发布的 Release;

